const ExpenseList = (props) => {

return (

    
    

    props.items.length === 0 ? <p>No Expenses Selected</p> :  props.items.length.map((expensesDone) => (<ExpenseItem key = {expensesDone.id} title = {expensesDone.newTitle} amount = {expensesDone.newAmount} date = {expensesDone.date}></ExpenseItem>))
);

}

export default ExpenseList;
